import React from "react";

function Profile (){
    return(
        <div className="Profile">
            <div style={{
                display:"flex",
                justifyContent: "space-around",
                
                flexDirection:"row"
                }}>
                <div  >
                    <img style={{width:"150px",height:"140px",borderRadius:"100%"}} src="https://pbs.twimg.com/media/Ez5yIwsVUAcW-U0.jpg:large" />
                </div>
                <div>
                    <h4>Pawan Kalyan</h4>
                </div>
            </div>
        </div>       
    );
}

export default Profile;
